class KakaoLogin{constructor(t,e){this.restKey=t,this.returnUrl=e,this.kakaoRedirectUrl="https://ozcodingschool.com/oauth"}kakaoSignIn=()=>{window.location.href=`https://kauth.kakao.com/oauth/authorize?client_id=${this.restKey}&redirect_uri=${this.kakaoRedirectUrl}&response_type=code&state=${this.returnUrl}&referrer=${localStorage.getItem("refer")}\n    }`}}